#include <iostream>
#include <cstdio>
#include <cmath>
using namespace std;
#define e 2.
double u0,ua,u1,n,t1;
double B()
{
    return log(u0-ua);
}
double K()
{

    return -(log(u1- ua)-B())/t1;
}
double T1(double tw)
{
    return (log(tw - ua) - B())/(-K());
}
double T2(double t)
{
    return ua +(u0-ua)*pow(e,(-K()*t));
}

int main()
{
    int x,y=0;
    cin>>x;
    while (x--)
    {
        y++;
        cin>>ua>>u0>>u1>>t1>>n;
        printf("Case %d:\n",y);
        while (n--)
        {
            int q;
            double k;
            cin>>q>>k;
            if (q == 0)
            {
                if (k == u0)
                printf("0.00\n");
                else
                printf("%.2lf\n",T1(k));

            }
            if (q == 1)
            printf("%.2lf\n",T2(k));
        }
        printf("\n");
    }
}
